import React from 'react';

const Rankings = ({players}) => {
    return (
        <div className="main"> 
            {players.map((player) => (
                <div style={{justifyContent:'center', alignItems:'center'}}>
                    <p className="name">{player.id}&#9;{player.name}</p>
                </div>
            ))}
        </div>
    )
}

export default Rankings
